import React from 'react';
import { connect } from 'react-redux';
import { withRouter } from 'react-router-dom';
import { Button } from 'antd';
import './pay-checkout.styles.scss';
import { createStructuredSelector } from 'reselect';
import { selectTotalPrice } from '../../../redux/cart/cart.selector';
import { selectCurrentUser } from '../../../redux/user/user.selector';
import ModelCheckout from '../checkout-page.component';

const PayCheckOut = ({ totalItem, currentUser, history }) => (
  <div className="pay-container">
    <h2>Order Summary</h2>
    <div>
      <p>Total : </p>
      <p>
        {totalItem}
        $
      </p>
    </div>
    <Button type="primary" style={{ width: '100%' }} onClick={() => history.push('/signInSignUp')}>Check Out</Button>
  </div>
);

const mapStateToProps = createStructuredSelector({
  totalItem: selectTotalPrice,
  currentUser: selectCurrentUser,
});

export default withRouter(connect(mapStateToProps)(PayCheckOut));
